import Link from 'next/link';

const Navbar = () => (
    <div className="j-top-nav">
        <div className='j-top-nav-container'>
            <div className="j-logo">
                <img src="https://image.shutterstock.com/image-vector/mountain-logo-260nw-505360261.jpg" style={{width: '10rem'}}/>
            </div>
            <div className="j-flex">
            </div>
        </div>
        <style jsx>{`
            .j-top-nav-container {
                margin: 10px 5%;
            }
            .j-flex {
                dislay: flex;
            }
        `}</style>
    </div>
)

export default Navbar
